INSERT INTO `protein` (`id`, `family_id`, `species_id`, `membrane_id`, `pdbid`, `name`, `resolution`, `topology`, `thickness`, `thicknesserror`, `tilt`, `tilterror`, `gibbs`, `tau`, `numsubunits`, `numstrands`, `verification`, `comments`, `date_added`) VALUES
(1, 35, 9, 3, '1qjp', 'Outer membrane protein A (OMPA), disordered loops', '1.65', 'A in', '25.4', '1.5', 11, 1, '-29.5', 'N.D.', 1, 8, 'Four interfacial Trp residues of OmpA are located at distances of 8-13 Ã… from the calculated bilayer center. This is close to 9-10 Ã… obtained by the parallax method (Kleinschmidt and Tamm 1999). Average tilt angle of TM beta-strands (39Â°) is slightly smaller than estimated by ATR FTIR (46Â°)(Ramakrishnan et al. 2005).', 'OmpA is required for the action of colicins K and L and for the stabilization of mating aggregates in conjugation. It also serves as a receptor for a number of T-even like phages and can act as a porin with low permeability that allows slow penetration of small solutes.', '2005-09-04'),
(2, 390, 9, 3, '1qj8', 'Outer membrane protein X (OMPX)', '1.90', 'A in', '23.6', '2.8', 12, 5, '-30.7', 'N.D.', 1, 8, 'Locations of the hydrophobic boundaries are consistent with  mapping of detergent-embedded areas of OmpX by NMR (Fernandez et al. 2002).', '   OmpX from Escherichia coli promotes adhesion to and entry into mammalian cells. <br/ >   It also has a role in the resistance against attack by the human complement system.<br/ >', '2005-09-04'),
(3, 363, 24, 3, '1p4t', 'Outer membrane protein NspA', '2.55', 'A in', '24.9', '2.4', 22, 3, '-42.9', '28', 1, 8, '', 'Pathogenic Neisseria spp. possess a repertoire of phase-variable Opacity proteins that mediate various pathogen--host cell interactions.', '2005-09-04'),
(1006, 286, 52, 15, '3lbw', 'M2 proton channel of Influenza A, closed state', '1.65', 'A out', '31.1', '1.7', 7, 10, '-50.5', '', 4, 4, '', '', '0000-00-00'),
(1007, 37, 310, 3, '2x55', 'Plasminogen activator PLA (coagulase/fibrinolysin)', '1.85', 'A in', '25.6', '1.9', 4, 5, '-43.9', '', 1, 10, '', '', '0000-00-00'),
(1008, 238, 36, 9, '1zhx', 'Oxysterol-binding protein homolog 4, conformation 1', '1.50', 'in', '1.2', '0.9', 90, 7, '-5.0', '', 1, 0, '', '', '0000-00-00'),
(6, 38, 24, 3, '1k24', 'Outer membrane adhesin/invasin OpcA', '2.03', 'A in', '25.4', '1.3', 10, 11, '-41.7', '19', 1, 10, '', 'Neisseria species specific OpcA proteins play an important role in meningococcal adhesion and invasion of both epithelial and endothelial cells.', '2005-09-04'),
(7, 39, 24, 3, '1uyn', 'Autotransporter  NalP', '2.60', 'X out', '25.3', '1.3', 8, 8, '-47.6', 'N.D.', 1, 12, '', '', '2005-09-04'),
(8, 40, 9, 3, '1qd6', 'Outer membrane phospholipase A, dimer', '2.10', 'C in', '23.9', '1.0', 0, 0, '-77.2', 'N.D.', 2, 24, 'Membrane boundary planes of monomeric form (1qd6C OPM entry) are consistent with detergent-covered region in crystals of monomeric phospholipase A (Snijder et al. 2003).', '', '2005-09-04'),
(9, 41, 9, 3, '1tly', 'Bacterial Nucleoside Transporter Ts', '3.00', 'A in', '23.4', '1.5', 8, 0, '-48.1', '41', 1, 12, '', '', '2005-09-04'),
(10, 42, 9, 3, '1t16', 'Fatty Acid Transporter FadL', '2.60', 'A out', '25.4', '1.3', 6, 7, '-58.0', '38', 1, 14, '', '', '2005-09-04'),
(11, 43, 9, 3, '3pox', 'Porin OmpF', '2.00', 'A in', '24.0', '0.8', 0, 0, '-136.2', 'N.D.', 3, 48, 'Results are consistent with experimental hydrophobic thickness of OmpF porin (Keeffe et al. 2000) and hydrophobic boundaries as determined by neutron diffraction in crystals with detergent (Pebay-Peyroula et al. 1995)', '', '2005-09-04'),
(12, 43, 16, 3, '1osm', 'Outer membrane protein C', '3.20', 'A in', '24.0', '1.1', 0, 0, '-136.6', 'N.D.', 3, 48, '', '', '2005-09-04'),
(13, 43, 8, 3, '2fgq', 'Anion-selective porin', '1.45', 'A in', '25.0', '0.9', 0, 0, '-130.8', 'N.D.', 3, 48, '', '', '2005-09-04'),
(14, 88, 30, 3, '2por', 'Porin', '1.80', 'A in', '23.4', '0.6', 0, 0, '-114.8', 'N.D.', 3, 48, '', '', '2005-09-04'),
(15, 88, 33, 3, '3prn', 'Porin', '1.90', 'A in', '23.2', '0.5', 0, 0, '-127.6', 'N.D.', 3, 48, '', '', '2005-09-04'),
(16, 44, 9, 3, '1af6', 'Maltoporin', '2.40', 'A in', '25.1', '0.7', 0, 0, '-117.9', '40', 3, 54, '', '', '2005-09-04'),
(17, 44, 278, 3, '2mpr', 'Maltoporin', '2.40', 'A in', '24.5', '1.0', 0, 0, '-109.7', 'N.D.', 3, 54, '', '', '2005-09-04'),
(18, 44, 278, 3, '1a0s', 'Sucrose-specific porin', '2.40', 'P in', '23.8', '1.1', 0, 0, '-103.5', 'N.D.', 3, 54, '', '', '2005-09-04'),
(19, 89, 9, 3, '1qfg', 'Ferric hydroxamate uptake receptor FhuA', '2.50', 'A in', '24.7', '1.0', 5, 1, '-81.3', '19', 1, 22, 'Average tilt of TM beta-strands (38Â°) is slightly smaller than estimated by ATR FTIR spectroscopy (44Â°)(Ramakrishnan et al. 2005).', 'This receptor binds the ferrichrome-iron ligand. It interacts with the tonB protein, which is responsible for energy coupling of the ferrichrome-promoted iron transport system. Acts as a receptor for bacteriophage T5 as well as T1, phi80 and colicin M. Binding of T5 triggers the opening of a high conductance ion channel. Can also transport the antibiotic albomycin.', '2005-09-04'),
(20, 89, 9, 3, '1fep', 'Ferric enterobactin receptor FepA', '2.40', 'A in', '24.3', '1.1', 1, 0, '-77.2', 'N.D.', 1, 22, 'Locations of hydrophobic boundaries are consistent with site-directed spin-labeling studies (Klug et al. 1997).', '', '2005-09-04'),
(21, 89, 9, 3, '1kmo', 'Outer membrane transporter FecA', '2.00', 'A in', '24.5', '1.2', 3, 0, '-69.6', 'N.D.', 1, 22, '', '', '2005-09-04'),
(22, 89, 9, 3, '1nqe', 'Outer membrane cobalamin transporter BtuB', '2.00', 'A in', '23.4', '1.0', 5, 0, '-68.8', '22', 1, 22, 'Locations of hydrophobic boundaries are consistent with site-directed spin-labeling studies (Fanucci et al. 2002).', 'Involved in the active translocation of vitamin B12 (cyanocobalamin) across the outer membrane to the periplasmic space. It derives its energy for transport by interacting with the trans-periplasmic membrane protein tonB. Is also a receptor for bacteriophages BF23 and C1, and for A and E colicins.', '2005-09-04'),
(23, 89, 28, 3, '2iah', 'Pyoverdine Outer Membrane Receptor FpvA', '2.70', 'A in', '24.0', '0.5', 8, 0, '-79.7', '15', 1, 22, '', '', '2005-09-04'),
(24, 46, 9, 3, '1ek9', 'Outer membrane protein TolC', '2.10', 'A in', '24.6', '1.4', 0, 2, '-56.1', 'N.D.', 3, 12, '', '', '2005-09-04'),
(25, 46, 46, 3, '1yc9', 'Multidrug Resistance (VceC) protein', '1.80', 'A in', '24.6', '1.0', 0, 0, '-62.2', 'N.D.', 3, 12, '', '', '2005-09-04'),
(26, 46, 28, 3, '1wp1', 'Drug-Discharge Outer Membrane Protein, OprM', '2.56', 'A in', '24.7', '1.2', 0, 0, '-64.0', 'N.D.', 3, 12, '', '', '2005-09-04'),
(27, 47, 39, 23, '7ahl', 'Alpha-hemolysin', '1.89', 'A out', '23.5', '0.9', 0, 1, '-49.3', 'N.D.', 7, 14, 'Several Trp residues of alpha-hemolysin (7ahl) are situated in the lipid head group\r\narea according to our results, which is consistent with their accessibility to water-soluble iodide and doxyl probes (Raja et al. 1999) and with locations of lipid head groups determined crystallographically (Galdiero and Gouaux 2004).', '', '2005-09-04'),
(28, 48, 22, 22, '1uun', 'Porin MspA', '2.50', 'A out', '40.7', '2.1', 0, 0, '-71.0', 'N.D.', 8, 16, 'The calculated intrinsic hydrophobic thickness of the MspA stem domain is ~41 Ã…. We consider this result be consistent with selective labeling of surface-exposed residues by membrane-impermeable probe (Mahfound et al., 2006). \r\nThe 96-Ã… long MspA protrudes the OM, and its rim is exposed from the extracellular side, while the stem base is facing the periplasmic space. I was  demonstrated that residues located in the stem part cannot be labeled when MspA is extracted from membranes but contains tightly-bound lipids (consistent with our calculations). However residues from the 30-Ã… long part of the rim adjacent to Î²-barrels can be labeled in extracted proteins but are protected when porin remains in native membranes (Mahfound et al., 2006). This ~30-Ã… long part of the rim may be protected from labeling in native membranes by the polysaccharide-rich outer layer that covers OM from outside, which is removed after protein extraction. ', '', '2005-09-04'),
(31, 19, 9, 2, '1ots', 'ClC chloride transporter', '2.50', 'A in', '29.7', '0.8', 0, 0, '-115.3', 'N.D.', 2, 28, '', '', '2005-09-04'),
(1130, 2, 38, 7, '3pl9', 'Light-harvesting complex CP29', '2.8', 'A in', '29.8', '1.6', 2, 2, '-66.6', '', 1, 3, '', '', '0000-00-00'),
(32, 19, 278, 2, '1kpl', 'ClC chloride transporter', '3.00', 'A in', '29.3', '0.8', 2, 1, '-128.0', 'N.D.', 2, 28, '', '', '2005-09-04'),
(33, 32, 19, 2, '1yew', 'Particulate methane monooxygenase', '2.80', 'B in', '28.2', '0.7', 0, 0, '-188.5', 'N.D.', 9, 42, '', '', '2005-09-04'),
(34, 20, 9, 2, '2oau', 'Mechanosensitive channel protein MscS, expanded state', '3.70', 'A out', '31.8', '0.8', 1, 1, '-171.3', 'N.D.', 7, 14, '', 'This is an open or another expanded state of the mechanosensor (Bass et al. 2002, Akitake et al. 2005). MscS is inserted in the "monotopic" mode (it does not transverse the bilayer), due to the missing (disordered) N-terminal segment of alpha-helix in each of seven subunits.  Key voltage-sensitive arginines remain outside of the calculated hydrophobic slab, in the lipid head group region.', '2005-09-04'),
(35, 21, 21, 8, '2oar', 'Mechanosensitive channel MscL, closed state', '3.50', 'A in', '36.1', '2.2', 0, 0, '-142.7', 'N.D.', 5, 10, 'Calculated membrane core boundaries of MscL seem to be consistent with spin-labeling and fluorescence studies (Perozo et al. 2001, Powl et al. 2003, 2005). However, calculated hydrophobic thickness is much larger than obtained in hydrophobic matching studies. ', '', '2005-09-04'),
(36, 16, 9, 2, '1rc2', 'Aquaporin Z', '2.5', 'A in', '29.7', '1.3', 0, 0, '-118.7', 'N.D.', 4, 32, '', '', '2005-09-04'),
(37, 16, 9, 2, '1ldf', 'Glycerol uptake facilitator', '2.10', 'A in', '30.1', '0.9', 0, 0, '-147.9', 'N.D.', 4, 32, '', '', '2005-09-04'),
(38, 22, 9, 2, '1u7g', 'Ammonia Channel', '1.40', 'A out', '29.8', '1.3', 0, 0, '-148.7', 'N.D.', 3, 33, '', '', '2005-09-04'),
(185, 16, 6, 4, '2b6p', 'Aquaporin-0, open state', '2.4', 'A in', '31.1', '1.5', 0, 1, '-130.0', '', 4, 32, '', '', '2005-09-25'),
(40, 81, 9, 2, '2cfp', 'Lactose permease 	lacY, structure at acidic pH', '3.30', 'A in', '31.1', '1.4', 2, 2, '-85.4', '14', 1, 12, 'Results are consistent with chemical modification and spin-labeling studies of lactose permease (Voss et al. 1996, Frillingos et al. 1998, Zhao et al. 1999, Kwaw et al. 2001, Guan et al. 2002, Ermolova et al. 2003, Venkatesan et al. 2000a,b,c, Zhang et al. 2003). Average tilt of TM helices (20Â°) is smaller than estimated by ATR FTIR (30Â°)(Le Coutre et al. 1997). Hydrophobic thickness is ~2.5A smaller than was calculated for the lower resolution structure (1pv6).', '', '2005-09-04'),
(41, 24, 9, 2, '1pw4', 'Glycerol-3-phosphate transporter glpT', '3.30', 'A in', '31.2', '1.4', 1, 7, '-92.5', '35', 1, 12, '', '', '2005-09-04'),
(42, 26, 9, 2, '1l7v', 'ABC transporter BtuCD, symmetric structure', '3.20', 'A in', '30.7', '1.1', 0, 1, '-121.0', 'N.D.', 2, 22, '', 'Part of the ABC transporter complex btuCDF involved in vitamin B12 import. Responsible for energy coupling to the transport system. The complex is composed of two ATP-binding proteins (btuD), two transmembrane proteins (btuC) and a solute-binding protein (btuF - not present in the crystal structure).', '2005-09-04'),
(43, 1, 32, 2, '1nkz', 'Light-harvesting complex LH2', '2.00', 'A in', '31.8', '0.6', 0, 0, '-193.5', 'N.D.', 18, 18, '', '', '2005-09-04'),
(44, 1, 32, 2, '1ijd', 'Light-harvesting complex LH3', '3.00', 'A in', '29.8', '0.7', 0, 0, '-174.6', 'N.D.', 18, 18, '', '', '2005-09-04'),
(45, 1, 35, 2, '1lgh', 'Light-harvesting complex', '2.40', 'A in', '29.7', '0.5', 0, 0, '-163.4', 'N.D.', 16, 16, '', '', '2005-09-04'),
(46, 2, 38, 7, '1rwt', 'Light-Harvesting Complex II', '2.70', 'A in', '30.0', '0.7', 0, 0, '-154.0', 'N.D.', 3, 9, '', '', '2005-09-04'),
(47, 3, 43, 2, '1eys', 'Photosynthetic reaction center, complex with cytochrome c', '2.20', 'L in', '31.6', '1.0', 2, 0, '-116.0', '32', 3, 11, '', '', '2005-09-04'),
(48, 3, 31, 2, '1l9b', 'Photosynthetic reaction center, complex with cytochrome c', '2.40', 'L in', '31.6', '0.8', 3, 0, '-127.3', '32', 3, 11, 'Hydrophobic thicknesses of photosynthetic reaction centers from Rhodopseudomonas sphaeroides are about 30 Ã… (Riegler and Mohwald 1986, Roth et al. 1991) or close to 35 Ã… (Pape et al. 1974).', 'Loop to helix transition in 50-residue N-terminal part of subunit M in this structure compare to other structures of photosynthetic reaction centers.', '2005-09-04'),
(49, 3, 34, 2, '1dxr', 'Photosynthetic reaction center, complex with cytochrome c', '2.00', 'L in', '31.8', '0.7', 5, 0, '-121.8', '25', 3, 11, 'Hydrophobic thicknesses of photosynthetic reaction centers from Rhodopseudomonas viridis are about 25-30 Ã… (Roth et al. 1989).', '', '2005-09-04'),
(51, 12, 31, 2, '1m56', 'Bacterial cytochrome c oxidase', '2.30', 'A in', '29.6', '1.8', 3, 0, '-173.7', 'N.D.', 4, 22, '', '', '2005-09-04'),
(52, 12, 27, 2, '1qle', 'Bacterial cytochrome c oxidase', '3.00', 'A in', '31.7', '1.3', 4, 0, '-167.4', 'N.D.', 4, 22, '', '', '2005-09-04'),
(2130, 85, 11, 4, '3spc', 'Potassium channel Kir 2.2,  complex with pyrophosphate lipid ', '2.45', 'A in', '30.6', '1.2', 0, 0, '-120.3', '', 4, 8, '', '', '0000-00-00'),
(54, 12, 9, 2, '1fft', 'Ubiquinol Oxidase', '3.50', 'A in', '29.5', '0.6', 12, 0, '-82.3', 'N.D.', 3, 19, '', '', '2005-09-04'),
(55, 7, 9, 2, '1kqf', 'Formate dehydrogenase', '1.60', 'B out', '33.7', '1.1', 0, 0, '-141.9', 'N.D.', 6, 15, '', '', '2005-09-04'),
(56, 8, 9, 2, '1q16', 'Respiratory Nitrate Reductase', '1.90', 'C out', '30.1', '0.9', 0, 0, '-126.9', 'N.D.', 2, 10, '', '', '2005-09-04'),
(57, 10, 9, 2, '1kf6', 'Fumarate reductase', '2.70', 'C in', '30.2', '1.2', 14, 2, '-65.6', '23', 2, 6, '', 'The calculations are conducted for one half of the complex, since the larger dimer  was assumed to be physiologically not relevant (Iverson et al. 1999).', '2005-09-04'),
(2136, 23, 45, 4, '4aq9', 'Nicotinic acetylcholine receptor, partially open state', '6.2', 'A out', '30.8', '0.8', 2, 0, '-109.5', '', 5, 20, '', '', '0000-00-00'),
