(60, 17, 41, 8, '1r3j', 'Potassium channel KcsA', '1.90', 'C in', '34.8', '1.2', 0, 0, '-111.0', 'N.D.', 4, 8, 'Locations of hydrophobic boundary planes are consistent with spin-labeling (Perozo et al. 1998, Cross et al. 1999, Cross and Hubbell 2002) and hydrophobic matching (Williamson et al. 2002, 2003) studies of KcsA.  Average tilt of TM helices (31Â°) is consistent with ATR FTIR data (33Â°)(Le Coutre et al. 1998).', '2k1e and 2kb2 are models of a water-soluble analogue; 1jq1 and 1jq2 are NMR models of a shorter segment.\r\n\r\nSeveral structures of the channel, which were deposited to the PDB without proper biomatrix (1zwi, 2atk, 2jk5, 2w0f and 3hpl), are taken from the PDBTM database.   ', '2005-09-04'),
