(72, 28, 20, 1, '1rh5', 'Protein translocase SecY, closed state, mutant', '3.20', 'A in', '29.0', '1.1', 10, 0, '-93.4', '14', 3, 12, 'Calculated orientation of hetero-trimeric SecY complex is similar to that in the 2D crystal where this protein forms a dimer of trimers (Breyton et al. 2002). Models of this translocon with bacterial ribosome were generated by MD fitting to EM map (3kcr and 3kc4 PDB entries). ', '', '2005-09-04'),
