(94, 15, 6, 4, '1gzm', 'Rhodopsin, inactive, complex with inverse agonist, 11-cis retinal', '2.70', 'A out', '32.2', '1.5', 11, 1, '-75.6', '18', 1, 7, 'Results are consitent with X-ray scattering  (Blaurock and Wilkins 1972),\r\nchemical modification (Barclay and Findlay 1984, Davison and Findlay 1986a,b) and electron microscopy (Krebs et al.  2003) studies. Hydrophobic boundaries of rhodopsin expand when calculated with detergent parameters (<a href="http://opm.phar.umich.edu/about.php?subject=experiments">Figure 4</a>), in agreement with results of Hubbell et al. (2003).', 'Structures of intermediate states: bathorodopsin (2g87) and lumirhodopsin (2hpy). Complex with 9-cis retinal: 2ped.', '2005-09-04'),
(96, 31, 25, 6, '3ar2', 'Calcium ATPase, E1-2Ca state, conformation 1', '2.50', 'A in', '29.6', '0.9', 25, 0, '-70.9', '10', 1, 10, 'Results are consistent with data about biological activity of ATPase in bilayers of various hydrophobic thicknesses (Cornea and Thomas 1994, Lee 1998).', 'Similar conformational states are indicated as related PDB entries.', '2005-09-04'),
