(100, 33, 14, 6, '1p49', 'Steryl-sulfatase', '2.60', 'A out', '29.6', '1.1', 23, 0, '-34.6', '18', 1, 2, '', '', '2005-09-04'),
(101, 84, 3, 23, '1grm', 'Gramicidin A, head-to-head dimer, right-handed', 'NMR', 'undef', '23.2', '4.0', 7, 9, '-28.1', 'N.D.', 2, 2, 'Structure in SDS micelles. Results are consistent with the experimental hydrophobic thickness of gramicidin A dimer (Elliott et al. 1983, Harroun et al. 1999) and with its nearly perpendicular arrangement to the membrane, as determined by solid state NMR and IR spectroscopy (Nabedryk et al. 1982, Andronesi et al. 2004, Andersen et al. 2005).  However, ATR FTIR spectroscopy gives a large dynamically averaged tilt angle (Kota et al. 2004).', '', '2005-09-04'),
