(595, 193, 9, 2, '1nlm', 'Peptidoglycan biosynthesis glycosyltransferase MurG, conformation 1', '2.5', 'in', '4.8', '1.1', 50, 7, '-7.5', '', 1, 0, '', 'This is a peripheral membrane protein involved in cell wall formation. Structures 1f0k and 1nlm have different conformations of loop 63-79 that interacts with membrane (probably due to binding of glycerol in 1nlm).\r\n\r\n\r\n', '2006-03-17'),
(596, 81, 9, 2, '2cfq', 'Lactose permease 	lacY, conformation 1', '2.95', 'A in', '31.9', '1.1', 5, 1, '-87.9', '', 1, 12, 'Results are consistent with chemical modification and spin-labeling studies of lactose permease (Voss et al. 1996, Frillingos et al. 1998, Zhao et al. 1999, Kwaw et al. 2001, Guan et al. 2002, Ermolova et al. 2003, Venkatesan et al. 2000a,b,c, Zhang et al. 2003). Average tilt angle of TM helices (20 degrees) is smaller than estimated by ATR FTIR (Le Coutre et al. 1997). Hydrophobic thickness is ~2 A smaller than was calculated for the lower resolution structure (1pv6).', '', '2006-03-17'),
(597, 238, 36, 9, '1zi7', 'Oxysterol-binding protein homolog 4 (KES1), N-terminal helix removed', '2.5', 'in', '2.5', '0.5', 75, 8, '-6.9', '', 1, 0, 'The results are consitent with membrane-binding orientation proposed by Im et al. (2005).', 'This is an engineered (lid-truncated) protein.', '2006-03-17'),
(673, 401, 39, 8, '2hyd', 'Multidrug ABC transporter SAV1866, closed state', '3.0', 'A in', '31.8', '1.7', 3, 3, '-110.5', '', 2, 12, '', 'TM portions of this transporter and lipid flippases have completely different 3D stuctures, although the proteins are homologous. EM-based model of homologous transporter from E.coli (2i68) also seems to be different. ', '0000-00-00'),
(683, 564, 239, 15, '1rer', 'Fusion glycoprotein E1', '3.2', 'out', '2.6', '2.0', 38, 5, '-6.5', '', 3, 0, 'Structures of mononers in the trimer are slightly different. The symmetry axis of the trimer is strongly tilted.  It is also tilted according to EM data. A really symmetric structure is a pentamer of the trimers (Gibbons et al. 2004). ', 'E1 is a class II viral fusion protein.  This trimeric (low-pH-iduced) form is fusion active, and promotes release of viral nucleocapsid in cytoplasm after cell and viral membrane fusion. Efficient fusion requires the presence of cholesterol and sphingolipid in the target membrane. N-terminal domain of this protein: 1dyl(NMR), 1vcp, 1vcq.', '0000-00-00'),
(598, 174, 53, 6, '1y5m', 'Corticosteroid 11-beta-dehydrogenase, isozyme 1', '2.3', 'out', '4.6', '0.4', 89, 2, '-19.3', '', 2, 0, 'N-terminal segment 7-23 from each subunit was shown to form a TM helix (single-pass  type II membrane protein). The dimer of water-soluble domains presumably associates with membranes through the C-terminal helices (Zhang et al. 2005), as calculated.', '', '0000-00-00'),
