(639, 245, 36, 6, '1nrj', 'Signal recognition particle receptor', '1.7', 'in', '3.9', '1.4', 82, 11, '-5.5', '', 2, 0, 'Membrane-associated protein (Schwartz and Blobel 2003). It has a TM helix 3-23 in beta subunit, which is compatible with calculated orientation (beta-subunit belongs to G-proteins).', 'Ensures, in conjunction with SRP, the correct targeting of the nascent secretory proteins to the endoplasmic reticulum membrane system. May be directly involved in mitochondrial protein import. Heterodimer of an alpha and a beta chain.', '0000-00-00'),
