(843, 274, 14, 4, '2k9j', 'Integrin alpha-IIb-beta-3 complex, structure 1', 'NMR', 'A out', '36.4', '3.3', 20, 1, '-56.4', '', 2, 2, '', 'This is a heterodimer in bicelle. Related PDB structures are shown for TM domain of integrin beta3 (2k1a is alphaIIb segment in bicelles; 2rmz and 2rn0 are NMR models of beta3 TM segment in bicelles). \r\n\r\n\r\nStructures of C-terminal cytoplasmic domain include partially unfolded conformations in the presence of micelles (2kv9,2l1c,1kup,1kuz,1m8o,1s4x) and folded crystal structures (1mk7,1mk9).\r\n\r\nStructures of N-terminal extracellular domain - see 3fcs.', '0000-00-00'),
